import React from 'react'

function Navbar() {
    return (
        <div className="navbar">
          <div className="toggleButton">
            <button
              onClick={() => {
                setExpandNavbar((prev) => !prev);
              }}
            >
              <ReorderIcon />
            </button>
          </div>
          <div className="links">
            <Link to="/"> Home </Link>
            <Link to="/projects"> Projects </Link>
            <Link to="/experience"> Experience </Link>
          </div>
        </div>
      );
}

export default Navbar
